/*
@author: Eligijus Skersonas
*/
import React from "react";
import { Line } from "react-chartjs-2";

LineChart = () => {
  const labels = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];

  return (
    <Line
      data={{
        label: "Dataset 1",
        data: labels.map(() => Math.random() * 1000),
        borderColor: "rgb(255, 99, 132)",
        backgroundColor: "rgba(255, 99, 132, 0.5)",
      }}
      height={400}
      width={600}
    />
  );
};

export default BarChart;
